import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import PatientDashboard from './pages/PatientDashboard';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Patient (sans PrivateRoute pour éviter erreurs) */}
          <Route path="/patient/*" element={<PatientDashboard />} />

          {/* Routes temporaires pour autres rôles */}
          <Route path="/medecin/*" element={<div className="p-8">Médecin Dashboard</div>} />
          <Route path="/admin/*" element={<div className="p-8">Admin Dashboard</div>} />

          {/* 404 */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
